import Input from "./Input";


function Login(){
    return (
        <div>
          <Input 
           type = "text"
           placeholder = "enter username"
          />
          <Input 
           type = "text"
           placeholder = "password"
          />
          <button>
              register
            </button>
        </div>
    )
}
export default Login;
